INSERT INTO `v1_10268ec2d9429fadc178085eea9b03993227b5900f8dc6bf27ae7f6b8bc4d11f` VALUES ("1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", 1, 3, "スタンダードコレクション", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 1);
INSERT INTO `v1_10268ec2d9429fadc178085eea9b03993227b5900f8dc6bf27ae7f6b8bc4d11f` VALUES ("1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 1, 10, "プレミアムコレクション", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 2);
INSERT INTO `v1_10268ec2d9429fadc178085eea9b03993227b5900f8dc6bf27ae7f6b8bc4d11f` VALUES ("1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", 1, 3, "フェスコレクション", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3);
